import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class Resume extends Component {
  render() {
    return (
      <div className='resume-body'>
        <Grid className='resume-grid'>
          <Cell cols={6}>TEst</Cell>
          <Cell cols={6}>TEst</Cell>
        </Grid>
        <h1>Resume </h1>
      </div>
    );
  }
}

export default Resume;
